;; **
;;; # L-systems
;;; 
;;; This worksheet looks at L-systems, see https://en.wikipedia.org/wiki/L-system.
;;; 
;;; Written at the London Clojure dojo 28/7/15 by Jony, Abby, and Krishna.
;; **

;; @@
(ns l-system
  (:require [gorilla-plot.core :as plot]
            [clojure.walk :as walk]
            [turtle.core :as turtle]
            [turtle.renderer.vector :as trv]
            [gorilla-repl.html :as html]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; An L-system specifies a set of rewrite rules that act on a string of symbols. This function takes a starting string of symbols and applies the given rules. The rules are passed as a map of symbol -> result pairs.
;; **

;; @@
(defn apply-rules-and-flatten
  [rules string]
  (vec (flatten (walk/postwalk-replace rules string))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;l-system/apply-rules-and-flatten</span>","value":"#'l-system/apply-rules-and-flatten"}
;; <=

;; **
;;; This function takes a starting string, cryptically called an axiom, and a set of rules, and iterates the rewrite process `n` times.
;; **

;; @@
(defn iterate-l-system
  [rules axiom n]
  (nth (iterate (partial apply-rules-and-flatten rules) axiom) n))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;l-system/iterate-l-system</span>","value":"#'l-system/iterate-l-system"}
;; <=

;; **
;;; Next we have a function to render the output of the successive rewrites. It uses rm-hull's Clojure turtle library https://github.com/rm-hull/turtle . Conveniently this comes with a renderer that generates SVG. We can use Gorilla REPL's `html-view` function to render this HTML inline. Pleasingly, if we express the mapping from the L-system's symbols to the turtle commands as a map, we can reuse our `apply-rules-and-flatten` function from above.
;; **

;; @@
(defn render-l-system
  [output render-rules]
  (let [turtle-commands (apply-rules-and-flatten render-rules output)]
    (html/html-view (turtle/draw! trv/->svg turtle-commands [400 300]))))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;l-system/render-l-system</span>","value":"#'l-system/render-l-system"}
;; <=

;; **
;;; Finally, we pull it all together.
;; **

;; @@
(defn plot-l-system
  [rules axiom n render-rules]
  (let [output (iterate-l-system rules axiom n)]
    (render-l-system output render-rules)))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;l-system/plot-l-system</span>","value":"#'l-system/plot-l-system"}
;; <=

;; **
;;; Some examples directly lifted from Wikipedia follow.
;;; 
;;; ### The "Dragon" curve
;; **

;; @@
(def dragon-rules {:f :f
                   :+ :+
                   :- :-
                   :x [:x :+ :y :f :+]
                   :y [:- :f :x :- :y]})

(def dragon-start [:f :x])

(def dragon-render-rules {:f [:fwd 20]
                          :+ [:right 90]
                          :- [:left 90]
                          :x []
                          :y []})
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;l-system/dragon-render-rules</span>","value":"#'l-system/dragon-render-rules"}
;; <=

;; @@
(plot-l-system dragon-rules dragon-start 12 dragon-render-rules)
